import React from "react";

function AllFirms() {
  return (
    <div style={{ margin: "2rem", textAlign: "center" }}>
      <h2>All Firms</h2>
      <p>
        Show a list or directory of all firms here, with filters or search
        functionality as needed.
      </p>
    </div>
  );
}

export default AllFirms;
